    this.BYLINE_SELECTORS = [];
    this.DIV_TO_P_ELEMS = new Set();
    this.ALTER_TO_DIV_EXCEPTIONS = [];
    this.PRESENTATIONAL_ATTRIBUTES = [];
    this.DEPRECATED_SIZE_ATTRIBUTE_ELEMS = [];
    this.PHRASING_ELEMS = new Set();
    this.CLASSES_TO_PRESERVE = [];

